import { Button, Col, Divider, Row, DatePicker, Card, Table, Select } from 'antd'
import React, { useState, useEffect } from 'react'
import { logdata_request, RealtimeData_Request } from '../../api'
import { C3Model, G2Model } from '../../DataRequest/DataModel'
import { ConvertMonentToDateTime, DataSortTime, VisualizeLogColumb } from '../../DataRequest/LogDataRequestWrap'
import { DataSortRT } from '../../DataRequest/RealTimeRequestWrap'
import RealTimeGraphWrapper from '../Realtime/RealTimeGraphWrapper'
import RealTimeTableWrapper from '../Realtime/RealTimeTableWrapper'


let C3DataModel = C3Model
let G2DataModel = G2Model
let BlankPage, data_filter = []
let C3DTRange=[] , G2DTRange=[]

let LogValue = {
    "C3Table": [],
    "G2Table": [],
    "C3Graph": [],
    "G2Graph": [],
    "C3Selected":[],
    "G2Selected":[],
}
let DateTimeRange
const { RangePicker } = DatePicker;
const { Option } = Select;


let OptionC3 = Object.keys(C3Model)
let OptionG2 = Object.keys(G2Model)

const OptionSelectorC3 = [];
const OptionSelectorG2 = [];



LogValue['C3Selected'] = [OptionC3[0], OptionC3[1]];
LogValue['G2Selected'] = [OptionG2[0], OptionG2[1]];

OptionC3.forEach(element => {
    OptionSelectorC3.push(<Option key={element}>{element}</Option>)
});
OptionG2.forEach(element => {
    OptionSelectorG2.push(<Option key={element}>{element}</Option>)
});

const columnsC3 = VisualizeLogColumb(OptionC3)
const columnsG2 = VisualizeLogColumb(OptionG2)


const Line1DataLog = () => {

    const [state, setState] = useState({ count: 0 });

  

    const UpdateTableData = async (Parameter, StartTime, EndTime, Site, Line, Page, BufferName, Model) => {
        console.log('ok');
        const response = await logdata_request(Parameter, StartTime, EndTime, Site, Line, Page)
        let data = DataSortTime(response)

        console.log(response);

        // LogValue[BufferName] = LogDataMappingName(Model, data)
        // setState(({ count }) => ({ count: count + 1 }));
    }

    const C3LogRequest = (DT) => {
        C3DTRange = ConvertMonentToDateTime(DT)
        // console.log(C3DTRange[0]);
        // console.log(C3DTRange[1]);

        UpdateTableData(LogValue['C3Selected'], C3DTRange[0], C3DTRange[1], 'C3', '1', "C3Table", C3Model)
    }

    const G2LogRequest = (DT) => {
        G2DTRange = ConvertMonentToDateTime(DT)
        console.log(G2DTRange[0]);
        console.log(G2DTRange[1]);
        console.log(LogValue['G2Selected']);

        UpdateTableData([], G2DTRange[0], G2DTRange[1], 'G2', BlankPage, "G2Table", G2Model)
    }


    return (
        <div>
            {/* <Button onClick={C3LogRequest}> test </Button> */}
            <RangePicker showTime onOk={C3LogRequest} />
            <Select
                mode="multiple"
                size="middle"
                placeholder="Please select"
                defaultValue={[OptionC3[0],OptionC3[1]]}
                style={{ width: '100%' }}
            >
                {OptionSelectorC3}
            </Select>

            <Card title='RealTime' bordered={true}
                style={{ width: '100%', borderRadius: 15, }} hoverable={true}>
                <Table bordered columns={columnsC3} dataSource={LogValue['C3Table']} size="small" scroll={{ y: 500 }} pagination={false} />
            </Card>


            <RangePicker showTime onOk={G2LogRequest} />
            <Select
                mode="multiple"
                size="middle"
                placeholder="Please select"
                defaultValue={[OptionG2[0],OptionG2[1]]}
                style={{ width: '100%' }}
            >
                {OptionSelectorG2}
            </Select>

            <Card title='RealTime' bordered={true}
                style={{ width: '100%', borderRadius: 15, }} hoverable={true}>
                <Table bordered columns={columnsG2} dataSource={LogValue['G2Table']} size="small" scroll={{ y: 500 }} pagination={false} />
            </Card>






        </div>
    )
}

export default Line1DataLog
